"use strict";browser.runtime.onMessage.addListener(function(t,e){if("masterSlates"==t.cmd)return new Promise(function(e){var n=new Request("http://json.rotogrinders.com/v2.00/"+t.date+"/slates/"+t.sport+"-master.json",{method:"GET"});fetch(n).then(function(t){return t.text().then(function(t){e({masterHtml:t})})})})});